import React from 'react';
import './repository.css';
import StackRecetteIcon from '../../images/stackrecette.jpg'


export class StackRecette extends React.Component {

    render() {
        return (
            <React.Fragment>
                <p className="projects-title">StackRecette</p>
                <img src={StackRecetteIcon} alt="app sample" className="sample"/>
                <p className="sr-description">
                The purpose of the app was to give people the fastest and easiest
                way to find a recipe from the user's ingredients. The target audience
                of the app was anyone who can not figure out what they would like
                for dinner. In addition, the user does require some cooking experience.
                The user will require an Android phone with Android Ice Cream Sandwich
                (4.0) or greater. And if you are running an emulator, you need an
                AVD that runs the Google api, including Google play services version
                15 and above.
                </p>
            </React.Fragment> 
        );
    }
}

